import React, { useState } from "react";
import Layout from "../../../Layout/Layout";
import "./style.css";
import { useDispatch } from "react-redux";
import { createAgents } from "../Home/homeSlice";
import LoginModal from "../../../components/LoginModal";
export default function CreateUser() {
  const dispatch = useDispatch();
  const [Open, setOpen] = useState(false);
  const initialstate = {
    fullname: "",
    email: "",
    phone: "",

  };
  const [user, setUser] = useState(initialstate);
  const [dping, setdping] = useState("");
  const [userid, setuserid] = useState("");
  const handlechange = (e) => {
    const { name, value } = e.target;
    setUser((prestate) => ({
      ...prestate,
      [name]: value,
    }));
  };
  const handlesubmit = () => {
    const payload = {
      ...user,
      userimg: dping,
      useridenti: userid,
    };
    dispatch(createAgents(payload));
    setUser(initialstate);
  };
  return (
    <div>
      <Layout setModal={setOpen}>
        <div className="create-user">
          <h2>Create Agents</h2>
          <div className="create">
            <input
              type="text"
              name="fullname"
              placeholder="Full Name"
              onChange={handlechange}
              value={user.fullname}
            />
            <input
              type="email"
              name="email"
              placeholder="Enter email"
              onChange={handlechange}
              value={user.email}
            />
            <input
              type="number"
              name="phone"
              id=""
              placeholder="Phone nm"
              onChange={handlechange}
              value={user.phone}
            />
            <input
              type="password"
              name="password"
              id=""
              placeholder="Set Password"
              onChange={handlechange}
              value={user.phone}
            />
            <button onClick={handlesubmit}>Create Agent</button>
          </div>
        </div>
        <div className="agentlist">
          <table>
            <tr>
              <th>Full Nmae</th>
              <th>Email Id</th>
              <th>Phone No</th>
              <th>Password</th>
              <th>Edit</th>
            </tr>
            <tr>
              <td>Alfreds Futterkiste</td>
              <td>Maria Anders</td>
              <td>Germany</td>
              <td>pass</td>
              <td>
                <span class="material-symbols-outlined">edit</span>
              </td>
            </tr>
          </table>
        </div>
        {Open && <LoginModal show={Open} setOpen={setOpen} />}
      </Layout>
    </div>
  );
}
